    public class func drawTextBlock(#frame: CGRect, arrowTintColor: UIColor, sgvText: String, bg_delta: String, textSizeForSgv: CGFloat, textSizeForDelta: CGFloat) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Color Declarations
        let arrowTintHighlightColor = arrowTintColor.colorWithHighlight(0.1)
        let arrowTintShadowColorDarker = arrowTintColor.colorWithShadow(0.6)

        //// Shadow Declarations
        let dropShaddow = NSShadow()
        dropShaddow.shadowColor = arrowTintShadowColorDarker.colorWithAlphaComponent(0.7)
        dropShaddow.shadowOffset = CGSizeMake(0.1, 0.6)
        dropShaddow.shadowBlurRadius = 1


        //// Subframes
        let group: CGRect = CGRectMake(frame.minX + floor((frame.width - 90) * 0.50000 + 0.5), frame.minY + floor((frame.height - 67) * 0.54687 + 0.5), 90, 67)


        //// Group
        CGContextSaveGState(context)
        CGContextSetShadowWithColor(context, dropShaddow.shadowOffset, dropShaddow.shadowBlurRadius, (dropShaddow.shadowColor as! UIColor).CGColor)
        CGContextBeginTransparencyLayer(context, nil)


        //// sgvLabel Drawing
        let sgvLabelRect = CGRectMake(group.minX, group.minY, 90, 54)
        let sgvLabelStyle = NSParagraphStyle.defaultParagraphStyle().mutableCopy() as! NSMutableParagraphStyle
        sgvLabelStyle.alignment = NSTextAlignment.Center

        let sgvLabelFontAttributes = [NSFontAttributeName: UIFont.systemFontOfSize(textSizeForSgv), NSForegroundColorAttributeName: arrowTintHighlightColor, NSParagraphStyleAttributeName: sgvLabelStyle]

        NSString(string: sgvText).drawInRect(sgvLabelRect, withAttributes: sgvLabelFontAttributes)


        //// deltaLabel Drawing
        let deltaLabelRect = CGRectMake(group.minX, group.minY + 46, 90, 21)
        let deltaLabelStyle = NSParagraphStyle.defaultParagraphStyle().mutableCopy() as! NSMutableParagraphStyle
        deltaLabelStyle.alignment = NSTextAlignment.Center

        let deltaLabelFontAttributes = [NSFontAttributeName: UIFont.systemFontOfSize(textSizeForDelta), NSForegroundColorAttributeName: arrowTintHighlightColor, NSParagraphStyleAttributeName: deltaLabelStyle]

        let deltaLabelTextHeight: CGFloat = NSString(string: bg_delta).boundingRectWithSize(CGSizeMake(deltaLabelRect.width, CGFloat.infinity), options: NSStringDrawingOptions.UsesLineFragmentOrigin, attributes: deltaLabelFontAttributes, context: nil).size.height
        CGContextSaveGState(context)
        CGContextClipToRect(context, deltaLabelRect);
        NSString(string: bg_delta).drawInRect(CGRectMake(deltaLabelRect.minX, deltaLabelRect.minY + (deltaLabelRect.height - deltaLabelTextHeight) / 2, deltaLabelRect.width, deltaLabelTextHeight), withAttributes: deltaLabelFontAttributes)
        CGContextRestoreGState(context)


        CGContextEndTransparencyLayer(context)
        CGContextRestoreGState(context)
    }

    public class func drawWatchFaceComposite(#frame: CGRect, arrowTintColor: UIColor, angle: CGFloat, isArrowVisible: Bool, doubleUp: Bool, sgvText: String, bg_delta: String, isUncomputable: Bool, computeAnimation: CGFloat, textSizeForSgv: CGFloat, textSizeForDelta: CGFloat) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// compassControl Drawing
        let compassControlRect = CGRectMake(frame.minX + floor(frame.width * 0.00000 + 0.5), frame.minY + floor(frame.height * 0.00000 + 0.5), floor(frame.width * 1.00000 + 0.5) - floor(frame.width * 0.00000 + 0.5), floor(frame.height * 1.00000 + 0.5) - floor(frame.height * 0.00000 + 0.5))
        CGContextSaveGState(context)
        UIRectClip(compassControlRect)
        CGContextTranslateCTM(context, compassControlRect.origin.x, compassControlRect.origin.y)

        NSAssetKit.drawWatchFaceOnly(frame: CGRectMake(0, 0, compassControlRect.size.width, compassControlRect.size.height), arrowTintColor: arrowTintColor, angle: angle, isArrowVisible: isArrowVisible, doubleUp: doubleUp)
        CGContextRestoreGState(context)


        if (isUncomputable) {
            //// computeCircle Drawing
            let computeCircleRect = CGRectMake(frame.minX + floor(frame.width * 0.00000 + 0.5), frame.minY + floor(frame.height * 0.00000 + 0.5), floor(frame.width * 1.00000 + 0.5) - floor(frame.width * 0.00000 + 0.5), floor(frame.height * 1.00000 + 0.5) - floor(frame.height * 0.00000 + 0.5))
            CGContextSaveGState(context)
            UIRectClip(computeCircleRect)
            CGContextTranslateCTM(context, computeCircleRect.origin.x, computeCircleRect.origin.y)

            NSAssetKit.drawUncomputedCircle(frame: CGRectMake(0, 0, computeCircleRect.size.width, computeCircleRect.size.height), arrowTintColor: arrowTintColor, isUncomputable: isUncomputable, computeAnimation: computeAnimation)
            CGContextRestoreGState(context)
        }


        //// textArea Drawing
        let textAreaRect = CGRectMake(frame.minX + floor(frame.width * 0.00000 + 0.5), frame.minY + floor(frame.height * 0.00000 + 0.5), floor(frame.width * 1.00000 + 0.5) - floor(frame.width * 0.00000 + 0.5), floor(frame.height * 1.00000 + 0.5) - floor(frame.height * 0.00000 + 0.5))
        CGContextSaveGState(context)
        UIRectClip(textAreaRect)
        CGContextTranslateCTM(context, textAreaRect.origin.x, textAreaRect.origin.y)

        NSAssetKit.drawTextBlock(frame: CGRectMake(0, 0, textAreaRect.size.width, textAreaRect.size.height), arrowTintColor: arrowTintColor, sgvText: sgvText, bg_delta: bg_delta, textSizeForSgv: textSizeForSgv, textSizeForDelta: textSizeForDelta)
        CGContextRestoreGState(context)
    }

    public class func drawUncomputedCircle(#frame: CGRect, arrowTintColor: UIColor, isUncomputable: Bool, computeAnimation: CGFloat) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Color Declarations
        let arrowTintShadowColor = arrowTintColor.colorWithShadow(0.2)
        let arrowTintShadowColorDarker = arrowTintColor.colorWithShadow(0.6)

        //// Shadow Declarations
        let dropShaddow = NSShadow()
        dropShaddow.shadowColor = arrowTintShadowColorDarker.colorWithAlphaComponent(0.7)
        dropShaddow.shadowOffset = CGSizeMake(0.1, 0.6)
        dropShaddow.shadowBlurRadius = 1

        if (isUncomputable) {
            //// uncomputableRing Drawing
            CGContextSaveGState(context)
            CGContextTranslateCTM(context, frame.minX + 0.50000 * frame.width, frame.minY + 0.52821 * frame.height)
            CGContextRotateCTM(context, -computeAnimation * CGFloat(M_PI) / 180)

            var uncomputableRingPath = UIBezierPath(ovalInRect: CGRectMake(-54, -54, 108, 108))
            CGContextSaveGState(context)
            CGContextSetShadowWithColor(context, dropShaddow.shadowOffset, dropShaddow.shadowBlurRadius, (dropShaddow.shadowColor as! UIColor).CGColor)
            arrowTintShadowColor.setStroke()
            uncomputableRingPath.lineWidth = 6.5
            CGContextSaveGState(context)
            CGContextSetLineDash(context, -2, [4, 6], 2)
            uncomputableRingPath.stroke()
            CGContextRestoreGState(context)
            CGContextRestoreGState(context)

            CGContextRestoreGState(context)
        }
    }

    public class func drawNightscoutLogo(#logoFrame: CGRect, logoTintColor: UIColor) {
        //// General Declarations
