    public class func drawAppStoreIcon(#logoTintColor: UIColor) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Symbol Drawing
        let symbolRect = CGRectMake(0, 0, 512, 512)
        CGContextSaveGState(context)
        UIRectClip(symbolRect)
        CGContextTranslateCTM(context, symbolRect.origin.x, symbolRect.origin.y)
        CGContextScaleCTM(context, symbolRect.size.width / 60, symbolRect.size.height / 60)

        NSAssetKit.drawSourceAppicon(logoTintColor: logoTintColor)
        CGContextRestoreGState(context)
    }

    public class func drawTableViewBackgroundView(#backgroundFrame: CGRect) {
        //// General Declarations
        let context = UIGraphicsGetCurrentContext()

        //// Color Declarations
        let logoShadowColor = NSAssetKit.appLogoTintColor.colorWithShadow(0.218)

        //// Gradient Declarations
        let tableBackgroundViewGradient = CGGradientCreateWithColors(CGColorSpaceCreateDeviceRGB(), [NSAssetKit.darkNavColor.CGColor, NSAssetKit.darkNavColor.blendedColorWithFraction(0.5, ofColor: logoShadowColor).CGColor, logoShadowColor.CGColor], [0, 0.51, 1])

        //// backgroundView Drawing
        let backgroundViewRect = CGRectMake(backgroundFrame.origin.x, backgroundFrame.origin.y, backgroundFrame.size.width, backgroundFrame.size.height)
        let backgroundViewPath = UIBezierPath(rect: backgroundViewRect)
        CGContextSaveGState(context)
        backgroundViewPath.addClip()
        CGContextDrawLinearGradient(context, tableBackgroundViewGradient,
            CGPointMake(backgroundViewRect.midX, backgroundViewRect.minY),
            CGPointMake(backgroundViewRect.midX, backgroundViewRect.maxY),
            0)
        CGContextRestoreGState(context)
    }

